import React from 'react';

const Answers = (props) => {
    let answers = props.answers.map((a, i) => <Answer key={i} answer={a} />)
    return (
        <div>
            {answers}
        </div>
    )
}

const Answer = (props) => {
    return (
        <div>
            <button onClick={checkAnswer()}>{props.answer}</button>
        </div>
    )
}

export default Answers;
